DROP DATABASE IF EXISTS air_data_hub;
CREATE DATABASE IF NOT EXISTS air_data_hub;

USE air_data_hub;

#------------------------------------------------------------
# Table: Reports
#------------------------------------------------------------
CREATE TABLE Reports(
    idReport    Int  Auto_increment  NOT NULL ,
    titleReport Varchar (255) NOT NULL ,
    dateReport  Date NOT NULL,

    CONSTRAINT Reports_PK PRIMARY KEY (idReport)
);

#------------------------------------------------------------
# Table: TypeGas
#------------------------------------------------------------
CREATE TABLE TypeGas(
    idType   Int  Auto_increment  NOT NULL ,
    nameType Varchar (255) NOT NULL,

    CONSTRAINT TypeGas_PK PRIMARY KEY (idType)
);

#------------------------------------------------------------
# Table: Gases
#------------------------------------------------------------
CREATE TABLE Gases(
    idGas      Int  Auto_increment  NOT NULL ,
    formulaGas Varchar (255) NOT NULL ,
    nameGas    Varchar (255) NOT NULL ,
    idType     Int NOT NULL,

    CONSTRAINT Gases_PK PRIMARY KEY (idGas),
    CONSTRAINT Gases_TypeGas_FK FOREIGN KEY (idType) REFERENCES TypeGas(idType)
);

#------------------------------------------------------------
# Table: Regions
#------------------------------------------------------------
CREATE TABLE Regions(
    idRegion   Int  Auto_increment  NOT NULL ,
    nameRegion Varchar (255) NOT NULL,

    CONSTRAINT Regions_PK PRIMARY KEY (idRegion)
);

#------------------------------------------------------------
# Table: Cities
#------------------------------------------------------------
CREATE TABLE Cities(
    idCity   Int  Auto_increment  NOT NULL ,
    nameCity Varchar (255) NOT NULL ,
    idRegion Int NOT NULL,

    CONSTRAINT Cities_PK PRIMARY KEY (idCity),
    CONSTRAINT Cities_Regions_FK FOREIGN KEY (idRegion) REFERENCES Regions(idRegion)
);

#------------------------------------------------------------
# Table: ActivitySectors
#------------------------------------------------------------
CREATE TABLE ActivitySectors(
    idSector   Int  Auto_increment  NOT NULL ,
    nameSector Varchar (255) NOT NULL,

    CONSTRAINT ActivitySectors_PK PRIMARY KEY (idSector)
);

#------------------------------------------------------------
# Table: Posts
#------------------------------------------------------------
CREATE TABLE Posts(
    idPost   Int  Auto_increment  NOT NULL ,
    namePost Varchar (255) NOT NULL,

    CONSTRAINT Posts_PK PRIMARY KEY (idPost)
);

#------------------------------------------------------------
# Table: Agences
#------------------------------------------------------------
CREATE TABLE Agences(
    idAgence   Int  Auto_increment  NOT NULL ,
    latAgence  Float NOT NULL ,
    longAgence Float NOT NULL ,
    idCity     Int NOT NULL,

    CONSTRAINT Agences_PK PRIMARY KEY (idAgence),
    CONSTRAINT Agences_Cities_FK FOREIGN KEY (idCity) REFERENCES Cities(idCity)
);

#------------------------------------------------------------
# Table: Personnel
#------------------------------------------------------------
CREATE TABLE Personnel(
    idPersonnel     Int  Auto_increment  NOT NULL ,
    lastName        Varchar (255) NOT NULL ,
    firstName       Varchar (255) NOT NULL ,
    birthDate       Date NOT NULL ,
    adress          Varchar (255) NOT NULL ,
    startDate       Date NOT NULL ,
    idAgence        Int NOT NULL ,
    idPost          Int NOT NULL,
    verificationCode    INT,

    CONSTRAINT Personnel_PK PRIMARY KEY (idPersonnel),
    CONSTRAINT Personnel_Agences_FK FOREIGN KEY (idAgence) REFERENCES Agences(idAgence),
    CONSTRAINT Personnel_Posts0_FK FOREIGN KEY (idPost) REFERENCES Posts(idPost)
);

#------------------------------------------------------------
# Table: Sensors
#------------------------------------------------------------
CREATE TABLE Sensors(
    idSensor    Int  Auto_increment  NOT NULL ,
    latSensor   Float NOT NULL ,
    longSensor  Float NOT NULL ,
    idGas       Int NOT NULL ,
    idSector    Int NOT NULL ,
    idPersonnel Int NOT NULL,

    CONSTRAINT Sensors_PK PRIMARY KEY (idSensor),
    CONSTRAINT Sensors_Gases_FK FOREIGN KEY (idGas) REFERENCES Gases(idGas),
    CONSTRAINT Sensors_ActivitySectors0_FK FOREIGN KEY (idSector) REFERENCES ActivitySectors(idSector),
    CONSTRAINT Sensors_Personnel1_FK FOREIGN KEY (idPersonnel) REFERENCES Personnel(idPersonnel)
);

#------------------------------------------------------------
# Table: Data
#------------------------------------------------------------
CREATE TABLE Data(
    idData   Int  Auto_increment  NOT NULL ,
    dateData Date NOT NULL ,
    ppmValue Float NOT NULL ,
    idSensor Int NOT NULL,

    CONSTRAINT Data_PK PRIMARY KEY (idData),
    CONSTRAINT Data_Sensors_FK FOREIGN KEY (idSensor) REFERENCES Sensors(idSensor)
);

#------------------------------------------------------------
# Table: Contain
#------------------------------------------------------------
CREATE TABLE Contain(
    idData   Int NOT NULL ,
    idReport Int NOT NULL,

    CONSTRAINT Contain_PK PRIMARY KEY (idData,idReport),
    CONSTRAINT Contain_Data_FK FOREIGN KEY (idData) REFERENCES Data(idData),
    CONSTRAINT Contain_Reports0_FK FOREIGN KEY (idReport) REFERENCES Reports(idReport)
);

#------------------------------------------------------------
# Table: Do
#------------------------------------------------------------
CREATE TABLE Do(
    idPersonnel Int NOT NULL ,
    idReport    Int NOT NULL,

    CONSTRAINT Do_PK PRIMARY KEY (idPersonnel,idReport),
    CONSTRAINT Do_Personnel_FK FOREIGN KEY (idPersonnel) REFERENCES Personnel(idPersonnel),
    CONSTRAINT Do_Reports0_FK FOREIGN KEY (idReport) REFERENCES Reports(idReport)
);

create table cities (
    id SERIAL primary key,
    name varchar(50),
    lat float,
    lon float
);

