DELIMITER //
CREATE PROCEDURE UpdatePersonnel()
BEGIN
    DECLARE i INT DEFAULT 0;
    DECLARE max_id INT DEFAULT 0;
    SELECT MAX(idPersonnel) INTO max_id FROM Personnel;
    WHILE i < max_id DO
            UPDATE Personnel
            SET verificationCode = FLOOR(100000 + RAND() * 900000)
            WHERE idPersonnel = i;
            SET i = i + 1;
        END WHILE;
END//
DELIMITER ;

CALL UpdatePersonnel();

